import styled from "styled-components";

function MovieDetail() {
  return (
    <Container>
      <Wrapper>상세보기</Wrapper>
    </Container>
  );
}

const Container = styled.div`
  padding: 30px 0;

  background: #eee;
`;

const Wrapper = styled.div`
  max-width: 900px;
  margin: 0 auto;
`;

export default MovieDetail;
